        self.label_5.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Jobs stops after </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#max_seconds\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">max_seconds</span></a><span style=\" font-family:\'Courier New\';\"> CPU time. Use this option</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in conjunction with option </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#restart_mode\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">restart_mode</span></a><span style=\" font-family:\'Courier New\';\"> if you need to</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">split a job too long to complete into shorter jobs that</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">fit into your batch queues.</span></pre><pre style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Courier New\';\"><br/></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">DEFAULT: 1E7, or 150 days, i.e. no time limit</span></pre></body></html>"))
