        self.label_7.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">kinetic energy cutoff (Ry) for wavefunctions</span></pre></body></html>"))
        self.label_7.setText(_translate("MainWindow", "Wavefunction Kinetic NRG Cutoff (Ry)"))
        self.tabWidget.setTabText(self.tabWidget.indexOf(self.tab_5), _translate("MainWindow", "System"))
        self.label_11.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"> Available options are:</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">\'david\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Davidson iterative diagonalization with overlap matrix</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">(default). Fast, may in some rare cases fail.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">\'cg\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Conjugate-gradient-like band-by-band diagonalization.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">MUCH slower than \'david\' but uses less memory and is</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">(a little bit) more robust.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">\'ppcg\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">PPCG iterative diagonalization</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">\'paro\', \'ParO\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">ParO iterative diagonalization</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">\'rmm-davidson\', \'rmm-paro\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">RMM-DIIS iterative diagonalization.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">To stabilize the SCF loop</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">RMM-DIIS is alternated with calls to Davidson or</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">ParO  solvers depending on the string used.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Other variables that can be used to tune the behavior of</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">RMM-DIIS are:  </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#diago_rmm_ndim\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">diago_rmm_ndim</span></a><span style=\" font-family:\'Courier New\';\"> and </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#diago_rmm_conv\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">diago_rmm_conv</span></a></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre></body></html>"))
        self.label_11.setText(_translate("MainWindow", "Diagonalization"))
        self.comboBox_4.setItemText(0, _translate("MainWindow", "david"))
        self.comboBox_4.setItemText(1, _translate("MainWindow", "cg"))
        self.comboBox_4.setItemText(2, _translate("MainWindow", "ppcg"))
        self.comboBox_4.setItemText(3, _translate("MainWindow", "paro"))
        self.comboBox_4.setItemText(4, _translate("MainWindow", "rmm-davidson"))
        self.label_15.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">mixing factor for self-consistency</span></pre></body></html>"))
        self.label_15.setText(_translate("MainWindow", "Mixing Beta"))
        self.label_12.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Convergence threshold for selfconsistency:</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">   estimated energy error &lt; conv_thr</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">(note that conv_thr is extensive, like the total energy).</span></pre><pre style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Courier New\';\"><br/></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">For non-self-consistent calculations, conv_thr is used</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">to set the default value of the threshold (ethr) for</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">iterative diagonalization: see </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#diago_thr_init\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">diago_thr_init</span></a></pre></body></html>"))
        self.label_12.setText(_translate("MainWindow", "Convergence Threshold"))
        self.label_13.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">label of the atom. Acceptable syntax:</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">chemical symbol X (1 or 2 characters, case-insensitive)</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">or chemical symbol plus a number or a letter, as in</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">&quot;Xn&quot; (e.g. Fe1) or &quot;X_*&quot; or &quot;X-*&quot; (e.g. C1, C_h;</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">max total length cannot exceed 3 characters)</span></pre></body></html>"))
        self.label_13.setText(_translate("MainWindow", "Atom"))
        self.label_14.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">mass of the atomic species [amu: mass of C = 12]</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Used only when performing Molecular Dynamics run</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">or structural optimization runs using Damped MD.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Not actually used in all other cases (but stored</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in data files, so phonon calculations will use</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">these values unless other values are provided)</span></pre></body></html>"))
        self.label_14.setText(_translate("MainWindow", "Atomic Mass"))
        self.label_16.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">File containing PP for this species.</span></pre><pre style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Courier New\';\"><br/></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">The pseudopotential file is assumed to be in the new UPF format.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">If it doesn\'t work, the pseudopotential format is determined by</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">the file name:</span></pre><pre style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Courier New\';\"><br/></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">*.vdb or *.van     Vanderbilt US pseudopotential code</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">*.RRKJ3            Andrea Dal Corso\'s code (old format)</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">none of the above  old PWscf norm-conserving format</span></pre></body></html>"))
        self.label_16.setText(_translate("MainWindow", "Pseudopotential File Name"))
        self.label_17.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Units for ATOMIC_POSITIONS:</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">alat :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">atomic positions are in cartesian coordinates, in</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">units of the lattice parameter (either celldm(1)</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">or A). If no option is specified, \'alat\' is assumed;</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">not specifying units is DEPRECATED and will no</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">longer be allowed in the future</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">bohr :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">atomic positions are in cartesian coordinate,</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in atomic units (i.e. Bohr radii)</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">angstrom :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">atomic positions are in cartesian coordinates, in Angstrom</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">crystal :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">atomic positions are in crystal coordinates, i.e.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in relative coordinates of the primitive lattice</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">vectors as defined either in card </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#CELL_PARAMETERS\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">CELL_PARAMETERS</span></a></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">or via the ibrav + celldm / a,b,c... variables</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">crystal_sg :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">atomic positions are in crystal coordinates, i.e.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in relative coordinates of the primitive lattice.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">This option differs from the previous one because</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in this case only the symmetry inequivalent atoms</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">are given. The variable </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#space_group\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">space_group</span></a><span style=\" font-family:\'Courier New\';\"> must indicate</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">the space group number used to find the symmetry</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">equivalent atoms. The other variables that control</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">this option are uniqueb, origin_choice, and</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">rhombohedral.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre></body></html>"))
